import { FormattedMessage } from 'react-intl';
import './styles/detalle.css';

function Detalle({ carro }){
    return (
        <div id="detail__container">
            <h1 id='car__title'>{carro.marca} {carro.linea}</h1>
            <img id='car__image' src={carro.imagen} alt={carro.marca}/>
            <ul>
                <li className='car__info'>
                    <FormattedMessage id='Referencia'/>:{carro.referencia}
                </li>
                <li className='car__info'>
                    <FormattedMessage id='Modelo'/>:{carro.modelo}
                    {carro.kilometraje}
                </li>
                <li className='car__info'>Color: {carro.color}</li>
            </ul>

        </div>
    );
}

export default Detalle;
